import React from 'react'
import Auxiliary from '../hoc/Auxiliary'
const BurgerBuilder = () => {
    return (
        <Auxiliary>
            <div>Burger Builder</div>
            <div>Burger Controller</div>
        </Auxiliary>
    )
}

export default BurgerBuilder
